import React,{Component} from 'react'
import axios from 'axios';



 class File extends Component {
   constructor(props){
     super(props)
     this.state={
       date:"",
       name:"",
       time:""
     }
   }

   changeNameAppoi=(e)=>{
     this.setState({name:e.target.value})
   }

   changeTimeAppoi=(e)=>{
     this.setState({time:e.target.value})
   }


   Addappoin=(e)=>{
     axios.post("http://127.0.0.1:8000/appointments/"+this.state)
   }



   changeDateAppoi=(e)=>{
     this.setState({date:e.target.value})
   }
   Addappoin=(e)=>{
     e.preventDefault()
     console.log(this.state)
     axios.post('http://127.0.0.1:8000/appointments/',this.state)
     .then(response=>{
       console.log(response)
     }) .catch(err=>{
       console.log(err)
     })

   }
render(){
  return(

    <div className='add'>
       <form onSubmit={this.Addappoin}>
<div>   <input type='text' placeholder='patient name' value={this.name} onChange={this.changeNameAppoi}/></div>
    <div>   <input type='date' placeholder='date' value={this.date} onChange={this.changeDateAppoi}/></div>
    <div>   <input className='timee' type='time' value={this.time} onChange={this.changeTimeAppoi}/></div>
    <div>   <button type='submit'>Add</button></div>

       </form>
    </div>
  )
}

 }
 export default File;
